const link = "https://firebasestorage.googleapis.com/v0/b/shop-7951b.appspot.com/o/products_images%2F"
const getlink = (myLink) => {
    return link+myLink
}
const getAllLinks = (...args) => {
    let linksMas = []
    args.forEach(i => linksMas.push(link+i))
    return linksMas
}
const initialState = {
    products : {
        accessories : {
            men: [
                {
                itemID: "1",
                name: "chain",
                mainFoto: getlink("Cuban5mmGold3.webp?alt=media&token=1f7420c0-e67c-414e-abcd-5f6224498acb"),
                fotos: getAllLinks("Cuban5mmGold.webp?alt=media&token=53743769-5e1c-46bd-99ec-5db72e1cd318","5mm925GoldCubanView2.webp?alt=media&token=da21d52b-14ba-46af-ad4a-9458b7ee19f1","s")
                }
            ],
            woman : [],
            kids: [],
        },
        bags : {
            men: [],
            woman : [],
            kids: [],
        },
        denim : {
            men: [],
            woman : [],
            kids: [],
        },
        "t-shirts" : {
            men: [],
            woman : [],
            kids: [],
        }
    }


}
export const productsReducer = (state = initialState, action) => {
    switch (action.type) {
        default:
            return state
    }
}
